static void printTestResult(jx_x64_context_t* ctx, const char* testName, const uint8_t* expectedOutput, uint32_t expectedSize)
{
	uint32_t sz = 0;
	const uint8_t* output = jx64_getBuffer(ctx, &sz);
	if (sz != expectedSize) {
		printf("%-50s: Failed: Invalid output size\n", testName);
	} else {
		const int32_t cmp = jx_memcmp(output, expectedOutput, sz);
		if (cmp != 0) {
			printf("%-50s: Failed: Wrong output\n", testName);
		} else {
			printf("%-50s: Pass\n", testName);
		}
	}
}

